import React from 'react';
import ToggleComponent from './custom/ToggleComponent.js';

const RizikoveFaktory = () => {


    const containerStyle = {
        width: '1000px',
        height: '2000px',
        margin: '100px',
        borderStyle: 'solid',
        boxSizing: 'border-box',
        justifyContent: 'center',

    };

  return (
    <div style={containerStyle}>
      <ToggleComponent
        title="Your Title"
        initialOpenState={false} // Set to true if you want it open by default
        content="Your paragraph content goes here."
      />


    </div>
  );
};

export default RizikoveFaktory;
